tables.table_schema:
CREATE TABLE Species (
  species_id INT PRIMARY KEY,
  species_name VARCHAR(50) NOT NULL,
  genus_name VARCHAR(50) NOT NULL
);

CREATE TABLE EvolutionaryRelationship (
  relationship_id INT PRIMARY KEY,
  ancestor_species_id INT,
  descendant_species_id INT,
  relationship_type VARCHAR(50) NOT NULL
);

CREATE TABLE Species (
    species_id INT PRIMARY KEY,
    species_name VARCHAR(255),
    genetic_data BYTEA
);

CREATE TABLE Phylogeny (
    phylogeny_id INT PRIMARY KEY,
    species_id INT,
    parent_phylogeny_id INT,
    FOREIGN KEY (species_id) REFERENCES Species(species_id)
);

